import React, { useState } from 'react';
import { Box, Typography, Dialog, DialogActions, DialogContent, DialogTitle, TextField, Paper, List, ListItem, ListItemText, IconButton, Tooltip, Button } from '@mui/material';
import FolderIcon from '@mui/icons-material/Folder';
import InsertDriveFileIcon from '@mui/icons-material/InsertDriveFile';
import AddIcon from '@mui/icons-material/Add';
import DeleteIcon from '@mui/icons-material/Delete';
import CreateNewFolderIcon from '@mui/icons-material/CreateNewFolder';

const CharacterManagement = () => {
    const [structure, setStructure] = useState([]);
    const [openDialog, setOpenDialog] = useState(false);
    const [newItem, setNewItem] = useState({ type: '', name: '' });

    const handleOpenDialog = (type) => {
        setNewItem({ type, name: '' });
        setOpenDialog(true);
    };

    const handleCloseDialog = () => {
        setOpenDialog(false);
    };

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setNewItem({ ...newItem, [name]: value });
    };

    const handleCreateItem = () => {
        if (newItem.name.trim() === '') return;

        if (newItem.type === 'folder') {
            setStructure([...structure, { type: 'folder', name: newItem.name, children: [] }]);
        } else if (newItem.type === 'file') {
            setStructure([...structure, { type: 'file', name: newItem.name }]);
        }

        handleCloseDialog();
    };

    const renderStructure = (items) => {
        return items.map((item, index) => (
            <ListItem key={index} style={{ paddingLeft: 20 }}>
                {item.type === 'folder' ? <FolderIcon /> : <InsertDriveFileIcon />}
                <ListItemText primary={item.name} />
                <IconButton edge="end" onClick={() => handleDeleteItem(index)}>
                    <DeleteIcon />
                </IconButton>
                {item.type === 'folder' && item.children && item.children.length > 0 && (
                    <List component="div" disablePadding>
                        {renderStructure(item.children)}
                    </List>
                )}
            </ListItem>
        ));
    };

    const handleDeleteItem = (index) => {
        setStructure(structure.filter((_, i) => i !== index));
    };

    return (
        <Box>
            <Typography variant="h5" gutterBottom>Gestion des Personnages</Typography>
            <Paper style={{ padding: 16, marginBottom: 16, display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
                <Typography variant="h6">Personnages</Typography>
                <Box>
                    <Tooltip title="Ajouter Dossier">
                        <IconButton color="primary" onClick={() => handleOpenDialog('folder')}>
                            <CreateNewFolderIcon />
                        </IconButton>
                    </Tooltip>
                    <Tooltip title="Ajouter Fiche">
                        <IconButton color="secondary" onClick={() => handleOpenDialog('file')}>
                            <AddIcon />
                        </IconButton>
                    </Tooltip>
                </Box>
            </Paper>
            <List>
                {renderStructure(structure)}
            </List>
            <Dialog open={openDialog} onClose={handleCloseDialog}>
                <DialogTitle>{`Ajouter un Nouveau ${newItem.type === 'folder' ? 'Dossier' : 'Fichier'}`}</DialogTitle>
                <DialogContent>
                    <TextField
                        autoFocus
                        margin="dense"
                        label="Nom"
                        name="name"
                        fullWidth
                        value={newItem.name}
                        onChange={handleInputChange}
                    />
                </DialogContent>
                <DialogActions>
                    <Button onClick={handleCloseDialog} color="primary">
                        Annuler
                    </Button>
                    <Button onClick={handleCreateItem} color="primary">
                        Ajouter
                    </Button>
                </DialogActions>
            </Dialog>
        </Box>
    );
};

export default CharacterManagement;
